def _get_object_count_by_type(exclude: Iterable[Any]=()) -> collections.Counter[str]:
    objects = gc.get_objects()
    object_types = [type(obj).__name__ for obj in objects if obj not in exclude]
    return collections.Counter(object_types)

import inspect
from typing import Dict
from typing import Any

def make_decorator(target, decorator_func, decorator_name=None,
    decorator_doc='', decorator_argspec=None):

    if decorator_name is None:
        decorator_name = decorator_func.__name__

    if decorator_argspec is None:
        decorator_argspec = inspect.getfullargspec(target)

    def decorated(*args, **kwargs):
        return decorator_func(*args, **kwargs)

    decorated.__name__ = decorator_name
    decorated.__doc__ = decorator_doc
    decorated.__signature__ = inspect.signature(target)
    decorated.__annotations__ = target.__annotations__

    return decorated
